/* eslint-disable jsx-a11y/img-redundant-alt */
import React, { Component } from "react";
import "./layout.css";

import picture from "./welcomepage.jpg";

function Home() {
  return (
    <div className="welcome-pic">
      <img src={picture} height="40%" width="70%" alt="picture" />
    </div>
  );
}

export default Home;
